import React from "react";
import logo from "../img/cuvette.svg";
const Header = () => {
  return (
    <header style={styles.header}>
      <div style={styles.logoSection}>
        <img src={logo} alt="Logo" style={styles.logo} />
      </div>
      <div style={styles.contactSection}>
        <span>Contact</span>
      </div>
    </header>
  );
};

const styles = {
  header: {
    backgroundColor: "#fff",
    padding: "10px 20px",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
  },
  logoSection: {
    display: "flex",
    alignItems: "center",
  },
  logo: {
    width: "60px",
    marginRight: "10px",
  },
  title: {
    color: "#333",
    fontSize: "24px",
    margin: 0,
  },
  contactSection: {
    display: "flex",
    alignItems: "center",
  },
  user: {
    display: "flex",
    alignItems: "center",
    marginLeft: "20px",
  },
  userCircle: {
    width: "24px",
    height: "24px",
    borderRadius: "50%",
    backgroundColor: "#ccc",
    marginRight: "10px",
  },
  dropdown: {
    padding: "5px",
    fontSize: "14px",
  },
};

export default Header;
